import './App.css';

function App() {
  return ( 
    <div className="App">
      <header>
        <div className="container">
          <div>
            <h1>header</h1>
          </div>
        </div>
      </header>
      <main>
        <h2>main</h2>
      </main>
      <footer>
        <h3>footer</h3>
      </footer>
    </div>
  );
}

export default App;
